import React from 'react';
import ReactDOM from 'react-dom';

function Newapp ()
{
    return (
        <ul>
            <li>Cricket</li>
            <li>Football</li>
            <li>Tennis</li>
        </ul>
    )
}

ReactDOM.render(<Newapp />,document.getElementById('root'));
